import styled from '@emotion/styled'


const Body = styled.div`
    background: #E5E5E5;
` 

const Layout = () => (
    <Body>
        <style jsx global>{`
            body {
                margin: 0;
                padding: 0;
                background-color: #E5E5E5;
            }
        `}</style>
        Hello
    </Body>
)

export default Layout;
